import React, { useState } from 'react';
import './CSS/Login.css'
// import 'bootstrap/dist/css/bootstrap.min.css';
const Login = () => {
    //states hook for testing purpose
    let [myEmail, setEmail] = useState('')
    const updateEmailTest = (email) => {
        setEmail(myEmail = email);
    };
    let [myPassword, setPassword] = useState('');
    const updatePassword = (password) => {
        setPassword(myPassword = password)
    };

    const verify = () => {
        if (true) {
            console.log("login test is set to true");
        }
    }
    const updateEmail = (newEmail) => {
        if (newEmail.length < 20) {
            console.log(newEmail);
        }
    }

    return (
        <div className="container">
            <div className="row">
                <div className="col-1">.</div>
                <div className="col">
                    <div className="Black-tranparent-box">
                    <h2 className="text-to-the-left">Sign in</h2>
                        <div className="login ">
                            <div className>
                                {/* email input */}
                                <input
                                    class="form-control"
                                    type="text"
                                    value={myEmail}
                                    onChange={e => updateEmailTest(e.target.value)}
                                />
                            </div>

                            <div>
                                {/* password input */}
                                <input
                                    class="form-control"
                                    type="password"
                                    // value={myPassword}
                                    onChaneg={e => updatePassword(e.targe.value)}
                                />
                            </div>
                            <div  >
                                <button className="login-b">
                                    Login
                                </button>
                                <div className="sign-up-b">
                                    Sign-up
                                </div>
                            </div>
                        </div>

                    </div>
                </div>
                <div className="col-1">.</div>
            </div>
        </div>

    )
}
export default Login;
